Having regard to Council Regulation (EEC) No 804/68 of 27 June 1968 on the common organization of the market in milk and milk products (1), as last amended by Regulation (EEC) No 2071/92 (2), and in particular Article 17 (4) thereof,
Whereas Commission Regulation (EEC) No 2551/93 (3) amending Annex I to Council Regulation (EEC) No 2658/87 of 23 July 1987 on the tariff and statistical nomenclature and on the Common Customs Tariff (4), as last amended by Regulation (EC) No 3080/93  (5), lays down amendments in the case of certain cheeses falling within CN code 0406;
Whereas Commission Regulation (EEC) No 3846/87 (6), as last amended by Regulation (EC) No 3198/93 (7), establishes an agricultural product nomenclature for export refunds on the basis of the tariff nomenclature; whereas this should be adjusted to take  account of the abovementioned amendment;
